      image={projectItem.image}
      title={projectItem.title}
      description={projectItem.description}
    />
  );
}

function Resume() {
  return (
    <div>
      <h1>
        <span>emojipedia</span>
      </h1>
      <dl className="dictionary">{cardItem.map(createEntry)}</dl>
    </div>
  );
}

export default Resume;
